.slide-container {
  display: block;
  position: relative;
  margin: 10vh auto;
  height: 450px;
  .text-content {
    width: 70vw;
    position: absolute;
    background-color: $accentOne;
    height: 450px;
    border-radius: 15px;
    &.text-content-right {
      padding: 1vw 15vw;
      right: 0;
    }
    &.text-content-left {
      padding: 1vw 15vw;
      left: 0;
    }
    h2 {
      font-size: 2rem;
    }
    p {
      font-size: 1.5rem;
    }
  }
  img {
    position: absolute;
    width: 350px;
    height: 350px;
    object-fit: cover;
    top: 50px;
    border-radius: 15px;
    &.slide-in {
      opacity: 0;
      transition: all $animationTime;
      &.active {
        opacity: 1;
        transform: translateX(0%);
      }
    }
    &.slide-in-right {
      transform: translateX(25%);
      left: 60vw;
    }
    &.slide-in-left {
      transform: translateX(-25%);
      right: 60vw;
    }
  }
}

















